import{_ as e}from"./plugin-vue_export-helper-DlAUqK2U.js";import{c as t,o,b as i}from"./app-DyL1PqmR.js";const n={},r=i('<p>National Robotics Engineering Center (NREC) - Software, MachineLearning, Computer Vision, Simulation, IT - Pittsburgh, PA, USA - Full Time - ONSITE, Hybrid - H1-B VISA</p><p>Mechanical Engineer: <a href="https://www.nrec.ri.cmu.edu/careers/mechanical-engineer.html" rel="nofollow">https://www.nrec.ri.cmu.edu/careers/mechanical-engineer.html</a></p><p>Electrical Engineer: <a href="https://www.nrec.ri.cmu.edu/careers/electrical-engineer.html" rel="nofollow">https://www.nrec.ri.cmu.edu/careers/electrical-engineer.html</a></p><p>Associate Director of Business Development: <a href="https://www.nrec.ri.cmu.edu/careers/associate-director-bd.html" rel="nofollow">https://www.nrec.ri.cmu.edu/careers/associate-director-bd.ht...</a></p><p>Explore All Featured Positions: <a href="https://www.nrec.ri.cmu.edu/careers/index.html" rel="nofollow">https://www.nrec.ri.cmu.edu/careers/index.html</a></p><p>NREC, a robotics research and development powerhouse, is looking for experienced developers, especially in embedded systems, robotics, perception, deep learning, data science, and AI. For over 27 years NREC has brought together a critical mass of software and hardware engineers to take technology from the laboratory to the real world. NREC maintains a diverse portfolio of projects, from Augmented Reality driver assistance to full off-road autonomy and from advanced teleoperation to full autonomous manipulation. We are part of the Robotics Institute at Carnegie Mellon University, focused on commercialization of robotic technologies. NREC employs 160 people in our off-campus facility.</p><p>Questions about NREC? Interested in a specific position? Contact our recruiters Christine DeCarolis (cdecarolis@nrec.ri.cmu.edu) and Nuvia Nishad (nnishad@nrec.ri.cmu.edu). Please mention Hacker News in your communication.</p>',7),a=[r];function c(s,l){return o(),t("div",null,a)}